var tracks = [];
var left = 0;
var right = 0;
var smallLargetracks = -1;

function getRandomInt(min, max) {
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function  selectTrack(prev){
    var result = 0;
    if(smallLargetracks === 1){
        if(prev === 0){
            result = getRandomInt(1,4);
        }
        else if((prev === 1 || prev === 2)){
            result = getRandomInt(3, 4);
            if(result === 3)
                left++;
            else 
                right++;
            if(left === 5)
                result = 4;
            else if(right === 5)
                result = 3;
        }
        else if((prev === 3 || prev === 4)){
            result = getRandomInt(1, 2);
            if(result === 1)
                right++;
            else
                left++;
            if(left === 5)
                result = 1;
            else if(right === 5)
                result = 2;
        }
    }
    else{
        if(prev === 0){
            result = getRandomInt(5,8);
        }
        else if((prev === 5 || prev === 6)){
            result = getRandomInt(7, 8);
            if(result === 7)
                left++;
            else 
                right++;
            if(left === 4)
                result = 8;
            else if(right === 4)
                result = 7;
        }
        else if((prev === 7 || prev === 8)){
            result = getRandomInt(5, 6);
            if(result === 4)
                right++;
            else
                left++;
            if(left === 4)
                result = 5;
            else if(right === 4)
                result = 6;
        }
    }
    return result;
}


function revertCar(){
    track1[0][33] = 1;
    track2[0][33] = 1;
    track3[0][14] = 1;
    track4[0][14] = 1;
    track5[0][33] = 1;
    track6[0][33] = 1;
    track7[0][14] = 1;
    track8[0][14] = 1;
}

var track = [];
var height = 32;
var trackheight = 32*11;
var trackwidth = 49;
var prevSegment = 0;
var result = 0;
var endPtr = 0;

function trackGeneration(){
    var carStatus = 0;
    smallLargetracks = getRandomInt(1, 2);
    for(var i=0;i<trackheight;i++){
        track.push([]);
    }
    var smalli =0;
    for(var i=0;i<trackheight;i++){
        if(i%height === 0){
            smalli = 0;
            prevSegment = selectTrack(prevSegment);
            tracks.push(prevSegment);
            if(carStatus !== 1){
                carStatus = 1;
                if(prevSegment === 1){
                    track1[0][33] = 6;
                }
                else if(prevSegment === 2){
                    track2[0][33] = 6;
                }
                else if(prevSegment === 3){
                    track3[0][14] = 6;
                }
                else if(prevSegment === 4){
                    track4[0][14] = 6;
                }
                else if(prevSegment === 5){
                    track5[0][33] = 6;
                }
                else if(prevSegment === 6){
                    track6[0][33] = 6;
                }
                else if(prevSegment === 7){
                    track7[0][14] = 6;
                }
                else if(prevSegment === 8){
                    track8[0][14] = 6;
                }
            }
        }
        if(i%height === 0 && i === (trackheight - height*2)){
            if(endPtr !== 1){
                endPtr = 1;
                track1[31][14] = 8;
                track1[31][15] = 8;
                track2[31][14] = 8;
                track2[31][15] = 8;
                track5[31][14] = 8;
                track5[31][15] = 8;
                track6[31][14] = 8;
                track6[31][15] = 8;
                track3[31][33] = 8;
                track3[31][34] = 8;
                track7[31][33] = 8;
                track7[31][34] = 8;
                track4[31][33] = 8;
                track4[31][34] = 8;
                track8[31][33] = 8;
                track8[31][34] = 8;
            }
        }
        /*if(i === 0 || i < height){
            for(var j=track[i].length;j<trackwidth;j++){
                track[i].push(jgrass[smalli][j]);
            }
            smalli++;
        }*/
        if(i >= (trackheight-height)){
            for(var j=track[i].length;j<trackwidth;j++){
                track[i].push(jgrass[smalli][j]);
            }
            smalli++;
        }
        else{
            if(prevSegment === 1){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track1[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 2){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track2[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 3){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track3[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 4){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track4[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 5){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track5[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 6){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track6[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 7){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track7[smalli][j]);
                }
                smalli++;
            }
            else if(prevSegment === 8){
                for(var j=track[i].length;j<trackwidth;j++){
                    track[i].push(track8[smalli][j]);
                }
                smalli++;
            }
            revertCar(prevSegment);
        }
    }
    //console.log("This is good one "+track);
    console.log("This is good one "+tracks);
}



